func (this *htmlMyTest) Bidi(w net_http.ResponseWriter, req *net_http.Request) {
	w.Write([]byte(Header(`MyTest`, `Bidi`)))
	jsonString := req.FormValue("json")
	someValue := false
	msg := &MyMsg{}
	validateMap := make(map[string]interface{})
	err := encoding_json.Unmarshal([]byte(jsonString), &validateMap)
	if err != nil {
		log.Printf("validator: %s ", err.Error())
	}
	if err == nil {
		for k, v := range validateMap {
			switch v.(type) {
			case string:
				vInt, err := strconv.ParseInt(v.(string), 10, 64)
				if err != nil {
					continue
				}
				validateMap[k] = vInt
			case float64:
				vInt := int(v.(float64))
				if vInt > math.MaxInt32 {
					vStr := strconv.Itoa(vInt)
					validateMap[k] = vStr
				}
			}
		}
		jsonBytes, err := encoding_json.Marshal(validateMap)
		if err != nil {
			log.Printf("re-marshal failed: %s ", err.Error())
		}
		jsonString = string(jsonBytes)
	}
	if len(jsonString) > 0 {
		err := encoding_json.Unmarshal([]byte(jsonString), msg)
		if err != nil {
			if err != io.EOF {
				w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
				return
			}
			w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
		}
		someValue = true
	}
	w.Write([]byte(FormMyTest_Bidi))
	if someValue {
		bidi, err := this.client.Bidi(golang_org_x_net_context.Background())
		if err != nil {
			if err != io.EOF {
				w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
				return
			}
			w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
		}
		err = bidi.Send(msg)
		if err != nil {
			if err != io.EOF {
				w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
				return
			}
			w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
		}
		reply, err := bidi.Recv()
		if err != nil {
			if err != io.EOF {
				w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
				return
			}
			w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
		}
		out, err := this.stringer(msg, reply)
		if err != nil {
			if err != io.EOF {
				w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
				return
			}
			w.Write([]byte("<div class=\"alert alert-danger\" role=\"alert\">" + err.Error() + "</div>"))
		}
		w.Write(out)
	}
	w.Write([]byte(Footer))
}

